import React, { Fragment } from 'react';
import {ReactComponent as FetechLogo} from "../../images/ProjetoLogoFetech2.svg";
import "./Home.css";
import Product from "./Product.js";

const productImage = new URL("../../images/3070.png", import.meta.url);

const product = {
  name: "Placa de Video RTX 3090 GALAX",
  images: {productImage},
  price: "R$ 3.50",
  _id: "256585",
};

const Home = () => {
      return ( <Fragment>
        <div className="banner">
            <p> Seja Bem Vindo | Ecommerce Fetech</p>
              <h1>Teste H1</h1>
              <a href="#container">
                  <button >
                  Scroll
                  </button>
              </a>
        </div>

        <div className="logoFetech">
                <FetechLogo width={150}/>
            </div>
            <p>Teste</p>

        <h2 className="homeHeading">Produtos Mais Procurados</h2>

        <div className="container" id="container"></div>
        <Product product = {product}/>
    </Fragment>
  );
};
export default Home;
